INSERT INTO payment_proof (order_id, file, extension, time)
SELECT order_status.order_id, proof.file, proof.extension, proof.time
FROM order_status
CROSS JOIN
(
    VALUES 
    ('\'::bytea, 'png', now()),
    ('\'::bytea, 'png', now())
) AS proof(file, extension, time)
WHERE status = 'WAITING_FOR_PAYMENT_CONFIRMATION'


